import Overview from "./Overview";
import Repositories from "./Repositories";
import Projects from "./Projects";

const Navbar = () => {
    return (
        <nav>
            <div className="flex justify-center ">
                <Overview />
                <Repositories />
                <Projects />
            </div>
        </nav>
    )
}
export default Navbar;
